// Thermolec Furnace Humidifier -<br />
//  over-flow  tube substitute.<br />
// by Kim Tyson - MakerBot TOM#003712<br />
//<br />
// This print assumes you have the original nut, the O-ring<br />
// and a matching die to thread the overflow tube or silicone.<br />
//<br />
// Extend your raft to 9mm beyond the edge of the print for stability.<br />
//<br />
// After printing, you will need an M12 x 1mm thread<br />
// die to match the thread of the original retaining<br />
// nut.  In a pinch or if you are American, a 7/16 x 24 threads per<br />
// inch die will work too on this particular model.<br />
// (reduce diameter to 10.5mm or 6.5/16 inch before<br />
// threading using sandpaper if necessary)<br />
//<br />
// If you don't have a die, you will have to construct your<br />
// own plastic threaded cylinder and a matching nut inside the<br />
// supplied scad file. If there are a lot of requests I<br />
// will consider doing it.<br />
//<br />
// Alternatively, you can just silicone it in.<br />
//<br />
// It is possible, due to over-build or shrinkage, that you<br />
// will have to adjust the radius of the threaded cylinder<br />
//<br />
// Also you may need to clean out the tubes water hole with a<br />
// 5/32 drill bit or equivalent by hand.<br />
//<br />
// The tubing nipple is the weakest part but you can<br />
// rework it for larger tubing which will be much stronger<br />
//<br />
// The original rubber O-ring should be re-used if you still have it<br />
// but remember it goes on the outside and underneath the humidifier.<br />
// Finger tighten the nut only - do not over-tighten.<br />
//<br />
// The original and printed tubes are shown on the TOM platform<br />
// standing upside down.  My original tube is broken in 3 pieces and<br />
// glued together for measurement.  A mop handle fell on the drain tube.<br />
//<br />
// The last picture shows the new overflow-tube already seated in the<br />
// humidifier with the vinyl drainage tube connected.
